export default function App()
{
    function getData() {
        return fetch("https://storage.googleapis.com/programiz-static/hiring/software/job-listing-page-challenge/data.json")
        
        .then((response) => response.json())

        .then((data) => JSON.stringify(data))

        .catch(error => { console.error(error) });
     }

     const data = getData();

     console.log(JSON.stringify(data));


    return(
        <div>
            Test
        </div>
    );
}
